import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap'
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import 'bootstrap/dist/css/bootstrap.min.css';

function BasicExample() {
  return (
    <Navbar expand="lg" className = 'm-3'>
      <Container justify-content-space-between>
        <Navbar.Brand href="#home" style = {{fontFamily: 'Sacramento, cursive', fontSize: '2rem', marginRight:'150px'}}>Fahad Al-Araik</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end" style = {{marginRight:'50px'}}>
          <Nav className = 'pl-3 pr-3' >
            <Nav.Link href="#home" className='active'>Home</Nav.Link>
            <Nav.Link>|</Nav.Link>
            <Nav.Link href="#about-me">About Me</Nav.Link>
            <Nav.Link>|</Nav.Link>
            <Nav.Link href="#skills">Skills</Nav.Link>
            <Nav.Link>|</Nav.Link>
            <Nav.Link href="#certificates">Certificates</Nav.Link>
            <Nav.Link>|</Nav.Link>
            <Nav.Link href="#projects">Projects</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default BasicExample;
